Iron Maiden - Flight 666: The film Productora: Banger Films, Phantom Music Management Director: Sam Dunn, Scot McFadyen Guion: Sam Dunn, Scot McFadyen Reparto: Vinny Appice, Bruce Dickinson, Ronnie James Dio, Janick Gers, Steve Harris, Kerry King, Andreas Kisser, Nicko McBrain, Tom Morello, Dave Murray, Adrian Smith, Lars Ulrich Genero: Documental, Musical Formato: Mp4 Sinopsis:Iron Maiden - Flight 666 registra la primera gira mundial, Somewhere Back In Time, que llevo a los ingleses a recorrer 70 mil kilometros en cinco continentes y presentarse 23 veces en apenas 45 dias a bordo del avion de la banda, el Boeing 757 Ed Force One piloteado por el vocalista Bruce Dickinson. Sam Dunn y Scot McFadyen son dos fans de la banda y tambien han dirigido los premiados documentales Metal; A Headbangers Story y Globe Metal. Flight 666 (Vuelo 666) inspirado en el codigo de aviacion del Ed Force One transportara a los espectadores a India, Australia, USA, Japon y muy especialmente a Latinoamerica donde podran verse los shows en ciudades como San Pablo, Santiago de Chile, Buenos Aires, San Jose de Costa Rica, Ciudad de Mexico, San Juan de Puerto Rico y Bogota, mostrando los momentos libres de la banda y la importante presencia de sus fanaticos. La pelicula fue realizada completamente en HD y sera exhibida unica y exclusivamente en formato digital - imagen de alta definicion y sonido 5.1 - con el objetivo de llevar a los espectadores la mejor experiencia audiovisual posible. Iron Maiden - Flight 666: The film
